class Solution(object):
    def evalRPN(self, tokens):
        """
        :type tokens: List[str]
        :rtype: int
        """
        num_stack = []
        opr_stack = []

        for i in tokens: 
            if i  in ['+','-','*','/']:
                opr_stack.append(i)
            else:
                num_stack.append(int(i))
            if opr_stack:
                i = opr_stack.pop()      
                a = num_stack.pop()
                b = num_stack.pop()
                if i == '+':
                    num_stack.append(b+a)
                elif i == '-':
                    num_stack.append(b-a)
                elif i == '*':
                    num_stack.append(b*a)
                else:
                    #  keep in mind that negtive integer division will round up down as well
                    sign = 1
                    if a*b < 0:
                        sign = -1
                    num_stack.append(sign * (abs(b)//abs(a)))


        return num_stack[0]
