def operators(opr):
    mapping  = {"+":lambda y,x : x+y,
                "-":lambda y,x : x-y,
                "*":lambda y,x : x*y,
                "/":lambda y,x : x/y if x*y>=0 else abs(x)/abs(y)*-1
                }   
    return mapping[opr]


class Solution(object):
    def evalRPN(self, tokens):
        """
        :type tokens: List[str]
        :rtype: int
        """
        nums = []
        for i in tokens:
            if i in ['+','-','*','/']:
                nums.append(operators(i)(nums.pop(),nums.pop()))
            else:
                nums.append(int(i))

        return nums[0]

if __name__ == '__main__':
    t1 = ["10","6","9","3","+","-11","*","/","*","17","+","5","+"]
    t2 = ["2", "1", "+", "3", "*"]
    t3 = ["4", "13", "5", "/", "+"]
    assert Solution().evalRPN(t1) == 22
    assert Solution().evalRPN(t2) == 9
    assert Solution().evalRPN(t3) == 6


    
